import React from 'react'
import { useNavigate } from 'react-router-dom';
import { useState } from 'react';
import { createContext } from 'react';
import { AppContext } from '../App';
import { useContext } from 'react';

function Babyplanner() {
const {data, setData} = useContext(AppContext)
  const navigate = useNavigate();
  const [showText, setShowText] = useState(false)
   


  const femaleFilter = () =>{
    let babyGender = data.baby.filter(i => i.gender === 'Female')
    // let babyGender = json.baby.filter(i => i.id === {option})
    // let babyGender = json.baby.filter(i => i.id === '25')
    setData(babyGender)
  }
  const maleFilter = () =>{
    let babyGender = data.baby.filter(i => i.gender === 'Male')
    setData(babyGender)
  }


  // create use state for each select value
  // const [data, setData] = useState()

  const dataList = []
  function clickHandler () {
    
    // dataList.forEach(element => {
    //   if (element[0]==='Girl' && element[1]===18){
    //         console.log("hi");
    //       }
    // });
   
     console.log(dataList);
      // console.log(setData(data.baby.filter(i => i.id === '25'))); 
    
    // else{
    //   console.log("Something");
    // }
    navigate('/data')
  }
  function selectGenderHandler (e) {
    let result
    result = e.target.value
    dataList.push(result)
    return result
  }
  function selectAgeHandler (a) {
    let result
    result = a.target.value
    dataList.push(result)
    return result
  }
  
  return (
    <div className="card w-96 bg-primary text-primary-content">
      <div>Data: 
        <AppContext.Provider value={{
      data,
      setData
     }}>
      </AppContext.Provider>
      {/* <div onClick={() => {setShowText(!showText)}}><div onClick={femaleFilter}>Female</div></div>
      <div onClick={() => {setShowText(!showText)}}><div onClick={maleFilter}>Male</div></div> */}
         <p onClick={() => {setShowText(!showText)}}><p onClick={femaleFilter}>Female</p></p>
      <p onClick={() => {setShowText(!showText)}}><p onClick={maleFilter}>Male</p></p>
      {showText === true && <Dashboard data ={data} />} 
      {/* {showText === true &&  <DataChart />} */}
        </div>
  <div className="card-body">
    <h2 className="card-title">Babyplanner</h2>
    <p>Note: Your age should be in range 18-40 years</p>
    
        
<div className='gender-choice'>
        <select onChange={selectGenderHandler} className="select select-info w-full max-w-xs">
  <option disabled selected>Select baby's gender you wish</option>
  <option>Girl</option>
  <option>Boy</option>
</select>
</div>
<div className='age-choice'>
<select onChange={selectAgeHandler} className="select select-info w-full max-w-xs">
  <option disabled selected>Select your age</option>
  <option>18</option>
  <option>19</option>
  <option>20</option>
  <option>21</option>
  <option>22</option>
  <option>23</option>
  <option>24</option>
  <option>25</option>
  <option>26</option>
  <option>27</option>
  <option>28</option>
  <option>29</option>
  <option>30</option>
  <option>31</option>
  <option>32</option>
  <option>33</option>
  <option>34</option>
  <option>35</option>
  <option>36</option>
  <option>37</option>
  <option>38</option>
  <option>39</option>
  <option>40</option>
</select>
</div>
      <button onClick={clickHandler} className="btn">Enter</button> 
    <div className="card-actions justify-end">
    </div>
  </div>
  
</div>
  )
}

export default Babyplanner
